description:
City of Portland Development Opportunity Services (DOS) Maintained by Portland Development Commission. The Development Opportunity Services (DOS) Program is applicable in some PDC urban renewal areas and target areas specified by the Bureau of Housing and Community Development. These are areas where strategies and plans are in place that meet PDC and citywide revitalization goals.

Program Guidelines and Requirements:

&quot;The Development Opportunity Services (DOS) Grant Program provides a maximum of $12,000 to businesses and property owners for evaluating development project feasibility. The program promotes PDC’s goals to stimulate redevelopment and private investment. The DOS Grant supports property owners and business tenants in their efforts to evaluate possible uses and improvements for underutilized properties; it is particularly aimed at assisting applicants who may not be familiar with the development process. The matching grant supports PDC’s goals of revitalization and economic development by encouraging commercial or industrial development, enhancing the livability of neighborhoods, and bringing new jobs to Portland.&quot;
